script: |
  super -f text -I q4209.spq | sort > q4209.out

inputs:
  - name: q4209.spq
    data: |
      SELECT DISTINCT + 8 + cor1.col2 AS col0 FROM tab0 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q4209.out
    data: |
      41
      9
      90
